  false,\n\t\"url\": null,\n\t\"notes\": \"Chemical, physical, and other data were
  collected using bottle, BT, current meter, MBT, meteorological sensors, and secchi
  disk casts from January 1, 1968 to December 4, 1968. Data were submitted by Stanford
  University; Hopkins Marine Station as part of the California Cooperative Fisheries
  Investigation (CALCOFI) project. Data were processed by NODC to the NODC standard
  F004 water physics and chemistry format. Full F004 Format descriptions are available
  from the NODC homepage at www.nodc.noaa.gov/.nnThe F004 format contains data from
  measurements and analysis of physical and chemical characteristics of the water
  column. Chemical parameters that may be recorded are salinity, pH and concentration
  of oxygen, ammonia, nitrate, phosphate, chlorophyll and suspended solids. Physical
  parameters that may be recorded include temperature, density (sigma-t), transmissivity
  and current velocity (east-west and north-south components). Cruise and station
  information may include environmental conditions of the study site at the time of
  observation. Data are very sparse prior to 1951.\",\n\t\"license_title\": null,\n\t\"extras\":
